Woodball
Woodball is a sport where a mallet is used to pass a ball through gates. This game can be played in grass, sand or indoor.{"citetype": "web", "url": "http://uswoodball.com/introduction.htm", "title": "Introduction", "author": "USWoodball"} The sport is in the program of Asian Beach Games and was incorporated in 2008.{"citetype": "web", "url": "http://www.ocasia.org/Sports/SportsT.aspx?6P1L9PlPuSggm5b9tvjaae0ZYYRbhFUf", "title": "Woodball", "author": "Olympic Council of Asia"} The International Woodball Federation is based in Taipei, Taiwan.{"citetype": "web", "title": "Historical innova www.facebook.com org/en/1-1.php", "website": "International Woodball Federation"}

History
The sport was invented in Taiwan by Weng Ming-hui and Kuang-chu Young in 1990. The Olympic Council of Asia made the sport a program of the Asian Beach Games in 2008.{"citetype": "news", "date": "July 6, 2007", "title": "MOFA honors inventor of woodball", "url": "http://www.taipeitimes.com/News/taiwan/archives/2007/07/06/2003368273"}

Championships
Ahris Sumariyanto attended the Asian Beach Games Danang 2016 with his Indonesian team-mates. He finished first and was awarded the gold medal. He only finished one hit ahead of Thailand's Jetsada Cheenkurd who finished with the sIlver medal in second. Kim Pyo Hwan from Korea was awarded the bronze medal and finished in third.{"citetype": "web", "url": "http://www.ocasia.org/News/IndexNewsRM.aspx?WKegervtea2cS9jtPGIk9A==", "title": "Woodball Asian Beach Games 2016"}
